// Fetch addresses from API
async function fetchAddresses(customerId, storeUrl) {
    
    const response = await fetch(`/apps/account-page/app/apiaddress?customerId=${customerId}&storeUrl=${storeUrl}`);
    if (!response.ok) throw new Error('Failed to fetch addresses');
    const data = await response.json();
    return {
        allAddress: data.allAddress || [],
        address: data.address || null,
        defaultAddress: data.defaultAddress || null
    };
}

// Delete address handler
async function handleDeleteSubmit(event, id, customerId, storeUrl) {
    event.preventDefault();
    const form = event.target;
    try {
        const response = await fetch(form.action, {
            method: 'POST',
            body: new FormData(form),
            headers: { Accept: 'application/json' },
        });
        if (!response.ok) throw new Error('Delete failed');
        closeDeletePop(id);
        const { allAddress, defaultAddress } = await fetchAddresses(customerId, storeUrl);
        injectDefaultAddress(defaultAddress, customerId, storeUrl);
        injectOtherAddresses(allAddress, defaultAddress ? defaultAddress.id : null, customerId, storeUrl);
        updateDefaultAddress(defaultAddress, customerId, storeUrl);
    } catch (error) {
        console.error('Error:', error);
        alert('Failed to delete address. Please try again.');
    }
}

// Edit address handler
async function handleEditSubmit(event, id, customerId, formIdName, storeUrl) {
    event.preventDefault();
    const form = event.target;
    const formData = new FormData(form);
    try {
        const response = await fetch(form.action, {
            method: 'POST',
            body: formData,
            headers: { Accept: 'application/json' },
        });
        if (!response.ok) throw new Error('Update failed');
        closeEditForm(event, formIdName);
        const { allAddress, defaultAddress } = await fetchAddresses(customerId, storeUrl);
        injectDefaultAddress(defaultAddress, customerId, storeUrl);
        injectOtherAddresses(allAddress, defaultAddress ? defaultAddress.id : null, customerId, storeUrl);
        updateDefaultAddress(defaultAddress, customerId, storeUrl);
    } catch (error) {
        console.error('Error:', error);
        alert('Failed to update address. Please try again.');
    }
}

// Add/Edit form injection
function addEditForm(id, address, customerId, formIdName, isNotDefault, storeUrl) {

    let addressId = id;
    address.id = addressId;
    const editDiv = document.createElement('div');
    editDiv.innerHTML = `
    <div class="edit-address-form">
      <div class="content-heading">Edit Address</div>
      <div class="edit-details-container profile-details-container">
        <div class="profile-details-display">
          <form
            method="post"
            action="/account/addresses/${address.id}"
            id="edit-address-form-${address.id}"
            onsubmit="handleEditSubmit(event, ${address.id}, ${customerId}, '${formIdName}','${storeUrl}')"
          >
            <input type="hidden" name="form_type" value="customer_address">
            <input type="hidden" name="utf8" value="">
            <input type="hidden" name="_method" value="put">
            <label class="edit-headings">Name (*)</label>
            <div class="row-flex">
              <input type="text" class="input-fields" name="address[first_name]" placeholder="first name" value="${address.first_name || ''}" required>
              <input type="text" class="input-fields" name="address[last_name]" placeholder="last name" value="${address.last_name || ''}">
            </div>
            <div class="row-flex">
              <div class="col-flex">
                <label class="edit-headings">Company</label>
                <input type="text" class="input-fields" name="address[company]" value="${address.company || ''}">
              </div>
              <div class="col-flex">
                <label class="edit-headings">Phone number (*)</label>
                <input type="tel" class="input-fields" name="address[phone]" value="${address.phone || ''}" pattern="^\\+?[\\d\\s\\-\\(\\)]{10,20}$" required>
              </div>
            </div>
            <label class="edit-headings">Address 1 (*)</label>
            <textarea class="input-fields" name="address[address1]" required>${address.address1 || ''}</textarea>
            <label class="edit-headings">Address 2</label>
            <textarea class="input-fields" name="address[address2]">${address.address2 || ''}</textarea>
            <div class="row-flex">
              <div class="col-flex">
                <label class="edit-headings">City (*)</label>
                <input type="text" class="input-fields" name="address[city]" value="${address.city || ''}" required>
              </div>
              <div class="col-flex">
                <label class="edit-headings">Country (*)</label>
                <input type="text" class="input-fields" name="address[country]" value="${address.country || ''}" required>
              </div>
            </div>
            <div class="row-flex">
              <div class="col-flex">
                <label class="edit-headings">Province</label>
                <input type="text" class="input-fields" name="address[province]" value="${address.province || ''}">
              </div>
              <div class="col-flex">
                <label class="edit-headings">Zip (*)</label>
                <input type="text" class="input-fields" name="address[zip]" value="${address.zip || ''}" required>
              </div>
            </div>
            ${isNotDefault == true ? `
            <label class="edit-headings">
                <input type="checkbox" name="address[default]" value="1"> Set as default
            </label>
            ` : '<div></div>'}
            <div class="btn-form">
<span class="edit-close" onclick="closeEditForm(event,'${formIdName}')">Back</span>
              <button type="submit" class="edit-submit">Save</button>
            </div>
          </form>
        </div>
      </div>
    </div>
    `;
    let container = document.querySelector('.address-form');
    if (formIdName === 'address-block-profile-') {
        container = document.querySelector('.edit-address-form-default');
    }
    if (container) {
        container.appendChild(editDiv);
    }
}

// Add address handler
async function handleAddAddress(event, customerId,storeUrl) {
    event.preventDefault();
    const form = event.target;
    const formData = new FormData(form);
    try {
        const response = await fetch(form.action, {
            method: 'POST',
            body: formData,
            headers: { Accept: 'application/json' },
        });
        if (!response.ok) throw new Error('Add failed');
        closeAddForm();
        const { allAddress, defaultAddress } = await fetchAddresses(customerId,storeUrl);
        injectDefaultAddress(defaultAddress, customerId,storeUrl);
        injectOtherAddresses(allAddress, defaultAddress ? defaultAddress.id : null, customerId,storeUrl);
        updateDefaultAddress(defaultAddress, customerId,storeUrl);
        form.reset();
    } catch (error) {
        console.error('Error:', error);
        alert('Failed to add address. Please try again.');
    }
}

// Update default address in profile section
function updateDefaultAddress(address, customerId,storeUrl) {
    const formIdName = 'address-block-profile-';
    const isNotDefault = false
    const container = document.querySelector('.profile-default-address .profile-address-container');
    if (!container) return;
    const title = container.querySelector('.profile-address');
    if (!address) {
        if (title) title.textContent = 'No Address Added';
        const nameElem = container.querySelector('.profile-address-name');
        if (nameElem) nameElem.textContent = '';
        const addressElem = container.querySelector('address.profile-address-line');
        if (addressElem) addressElem.innerHTML = '';
        const phoneElem = container.querySelector('.profile-details:not(.profile-address-line)');
        if (phoneElem) phoneElem.textContent = '';
        const editIcon = container.querySelector('.edit-icon');
        if (editIcon) editIcon.innerHTML = '';
        return;
    }
    if (title) title.textContent = 'Default';
    const nameElem = container.querySelector('.profile-address-name');
    if (nameElem) nameElem.textContent = `${address.first_name || ''} ${address.last_name || ''}`.trim();
    const addressElem = container.querySelector('address.profile-address-line');
    if (addressElem) {
        let html = '';
        if (address.company) html += `${address.company}<br>`;
        if (address.address1) html += `${address.address1}<br>`;
        if (address.address2) html += `${address.address2}<br>`;
        if (address.city) html += `${address.city}, `;
        if (address.province) html += `${address.province}<br>`;
        if (address.country) html += `${address.country}<br>`;
        if (address.zip) html += `${address.zip}`;
        addressElem.innerHTML = html;
    }
    const phoneElem = container.querySelector('.profile-details:not(.profile-address-line)');
    if (phoneElem) phoneElem.textContent = address.phone || '';
    let id = getIdFromGid(address.id);
    const savingDiv = container.querySelector('.saving-address');
    if (savingDiv && id) savingDiv.id = `default-address-${id}`;
    if (id) {
        const existingEdit = container.querySelector('.edit-icon');
        if (existingEdit) {
            existingEdit.setAttribute('onclick', `addressEdit(${id},${JSON.stringify(address)},${JSON.stringify(formIdName)},${customerId}, ${isNotDefault},'${storeUrl}')`);
            existingEdit.innerHTML = `<svg width="14" height="15" viewBox="0 0 14 15" fill="none" xmlns="http://www.w3.org/2000/svg"><path d="M8.20968 2.79498C8.64437 2.32401 8.86172 2.08853 9.09268 1.95117C9.64996 1.61974 10.3362 1.60943 10.9027 1.92398C11.1375 2.05435 11.3616 2.2832 11.8096 2.74091C12.2577 3.19861 12.4817 3.42747 12.6093 3.66734C12.9172 4.24612 12.9072 4.94709 12.5827 5.51637C12.4482 5.7523 12.2177 5.97433 11.7567 6.41838L6.27122 11.7018C5.39753 12.5433 4.96069 12.9641 4.41472 13.1773C3.86876 13.3906 3.26856 13.3749 2.06815 13.3435L1.90482 13.3392C1.53938 13.3296 1.35666 13.3249 1.25045 13.2043C1.14423 13.0838 1.15873 12.8977 1.18773 12.5254L1.20348 12.3233C1.28511 11.2755 1.32592 10.7517 1.53052 10.2808C1.73511 9.80985 2.08802 9.42748 2.79385 8.66275L8.20968 2.79498Z" stroke="#565656" stroke-width="1.5" stroke-linejoin="round"/><path d="M7.58337 2.86182L11.6667 6.94515" stroke="#565656" stroke-width="1.5" stroke-linejoin="round"/><path d="M8.16669 13.3618L12.8334 13.3618" stroke="#565656" stroke-width="1.5" stroke-linecap="round" stroke-linejoin="round"/></svg>`;
        }
    }
}

